"""## Valles Marineris

Otra formacin geolgica muy interesante de Marte son los **Valles Marineris** (que significa *Valles de Mariner* en latn, en referencia al orbitador marciano Mariner 9, que vol entre 1971 y 1972). Se trata de un sistema geolgico superficial marciano que se extiende desde el este de la regin de Tharsis a lo largo del Ecuador y mide ms de 3000 km de largo, 600 km de ancho en algunos tramos y unos impresionantes 8 km de profundidad. Errneamente, algunos intentan comparar el sistema de caones de los *Valles Marineris* con el Gran Can de la Tierra, y demostraremos que esta comparacin es prcticamente imposible.

Primero, separemos la regin donde se encuentra este sistema, que se extiende aproximadamente entre 110O y 15O (250-345 en el sistema de coordenadas del mapa, que va de 0 a 360).
"""

# Valles Marineris
marineris = [360-110,360-15,-25,5]

dset_marineris = dset_mars.sel(latitude=slice(marineris[3],marineris[2]),longitude=slice(marineris[0],marineris[1])).alt.astype('float')
dset_marineris.plot()

"""Tenga en cuenta que el sistema de caones se extiende desde una regin muy alta (aprox. 8000 m) hasta una zona ms baja (aprox. -8000 m). Utilizaremos 'PyGMT' para extraer una franja proporcional de la superficie terrestre, geogrficamente de dimensiones similares, que contenga el rea geogrfica del Gran Can. Sin embargo, controle sus expectativas. Ver que es imposible comparar el tamao de ambos sistemas."""

# Obtenga SRTM alrededor del Gran Can
grandcanyon = [360-120,360-25,15,45]
topo_grandcanyon = pygmt.datasets.load_earth_relief(region=grandcanyon,resolution="05m")

"""Ahora usando 'PyGMT'. Tenga en cuenta que usaremos las mismas proyecciones, solo que desplazaremos el mapa de la superficie terrestre hacia un lado para permitir una comparacin de escala. La flecha seala la ubicacin del Gran Can.<br>
Tenga en cuenta que, justo despus de trazar cada mapa, usamos la funcin 'text' para escribir los textos "Marte" y "Tierra", adems de "Gran Can". La regin y la proyeccin de este comando son planas, lo que permite una buena flexibilidad para colocar cualquier texto en el mapa. Puede agregar 'frame="a"' al comando 'fig.text' para ver dnde est el borde de este marco. Esto le ayudar a colocar el texto de la forma ms conveniente.
"""

fig = pygmt.Figure()

with fig.subplot(nrows=1, ncols=2, figsize=("20c", "8c"), autolabel=False, margins="1c"):

    with fig.set_panel(panel=0):

        frame =  ["xa20f5","ya5f5", "z5000+lmeters", "wSEnZ"]

        # Primer mapa
        fig.grdview(grid=dset_marineris,
                    region=marineris+[-5000,10000],
                    frame=frame,
                    perspective=[120,45],
                    projection='M15c',
                    zsize='4c',
                    surftype='i',
                    cmap='geo',
                    plane="-5000+ggrey",
                    shading='+d')

        fig.colorbar(frame=["a2500", "x+lElevation", "y+lm"],
                     position="JML+o2c/1c+w7c/0.5c",)
        # texto (tenga en cuenta que la proyeccin es un cuadrado simple sobre el mapa)
        fig.text(x=0.35,y=0.2,text='Mars',font='36p,Helvetica,black',
                 region=[0,1,0,1],
                 projection='X10c',
                #frame='a'
                )
        fig.text(x=0.35,y=0.10,text='Valles Marineris',font='22p,Helvetica,black')

    with fig.set_panel(panel=1):
        # segundo mapa
        fig.grdview(grid=topo_grandcanyon,
                    region=grandcanyon+[-5000,10000],
                    frame=frame,
                    perspective=[120,45],
                    projection='M15c',
                    zsize='4c',
                    surftype='i',
                    cmap='geo',
                    plane="-5000+ggrey",
                    shading='+d')
        # Flecha qie indica la ubicacin del Gran Can
        fig.plot3d(perspective=True,x=-112.1,y=36.1,z=0,style="v0.5c+b+gorange+h0+p1p,black",pen='2p',direction=[[50],[3]])

        # texto (tenga en cuenta que la proyeccin es un cuadrado simple sobre el mapa)
        fig.text(x=0.3,y=0.2,text='Earth',font='36p,Helvetica,black',
                 region=[0,1,0,1.5],
                 projection='X10c/15c',
                #frame='a'
                )
        fig.text(x=0.65,y=1.62,text='Grand Canyon',justify='LM',font='14p,Helvetica,black',no_clip=True)

fig.show()

fig.savefig("VallesMarineris.png")

"""## Jezero Crater

Uno de los sitios ms populares de Marte es el crter Jezero, ya que el [NASA's Perseverance rover](https://mars.nasa.gov/mars2020/mission/science/landing-site/) est explorando las inmediaciones del crter, que se crea inundado. Los datos indican que este crter contiene un depsito de abanico fluvial rico en arcilla. <br>

Aqu vamos a crear un mapa de los alrededores del crter con 'PyGMT', un buen ejercicio que combina elementos bsicos de cartografa con anotaciones de texto. Tenga en cuenta que para llegar a la versin final, es necesario probar, trazar, modificar y volver a probar hasta que el texto dentro de la figura, sus tamaos y colores, queden exactamente donde desea.<br>

Si desea explorar la ubicacin del Perseverance, puede consultar https://mars.nasa.gov/mars2020/mission/where-is-the-rover/.
"""

# Jezero
jezero = [65,85,12,28]

dset_jezero = dset_mars.sel(latitude=slice(jezero[3],jezero[2]),longitude=slice(jezero[0],jezero[1])).alt.astype('float')
dset_jezero.plot()

fig = pygmt.Figure()

frame =  ["a5f1g5","WSen"]

with pygmt.config(FONT='20p'): # Jugar un poco con el tamao de la fuente
    # A continuacin se crea el mapa
    fig.grdimage(grid=dset_jezero,
                region=jezero,
                frame=frame,
                projection='M20c',
                cmap='geo',
                shading='+d'
                )

    fig.colorbar(frame=["a1000", "x+lElevation", "y+lm"],
                 position="JMR+o1c/0c+w12c/0.5c",)

#  y pongamos un pequeo mapa de Marte para mostrar la posicin.
with fig.inset(position="JTR+w3.5c+o0.2c", margin=0, box=None):
    # Crea una figura complementaria en el recuadro utilizando la proyeccin global centrada en Jezero
    fig.grdimage(grid=dset_mars_topo,cmap='geo',region='g',frame='g',projection='G75/20/3.5c')

    bounds = [[jezero[0],jezero[2]],
          [jezero[0],jezero[3]],
          [jezero[1],jezero[3]],
          [jezero[1],jezero[2]],
          [jezero[0],jezero[2]]]

    fig.plot(bounds,pen="1p,red")

# Ahora vamos a escribir algo de texto relacionado con las caractersticas de la superficie.
features = [[76.3,20.5,0,'Jezero Crater','28p,Helvetica-Bold,white','LM'],
            [80,14,0,'Isidis Planitia','14p,Helvetica-Bold,white','CM'],
            [67,13,0,'Syrtis Major','14p,Helvetica-Bold,black','CM'],
            [74.8,21.8,56,'Nili fossae','14p,Helvetica-Bold,black','LM'],
            [84,25.5,0,'Peridier','10p,Helvetica-Bold,black','CM'],
            [65.1,22.8,0,'Baldet','10p,Helvetica-Bold,black','LM'],]

for feature in features:
    fig.text(x=feature[0],y=feature[1],
             angle=feature[2],
             text=feature[3],
             font=feature[4],
             justify=feature[5])

# Crea un crculo en el crter Jezero
fig.plot(x=75.8,y=20.7,style='c0.9c',pen='2p,red')


fig.show()

fig.savefig("JezeroCrater.png")

